import React, { useState, useEffect } from 'react';




const Card = ({ apiKey }) => {
    const [data, setData] = useState([]);

    const getUser = async () => {
        const response = await fetch('https://api.data.gov.in/resource/93b75aee-8eed-4fd5-913f-8284ffe733e8?api-key=579b464db66ec23bdd000001d8a81c4d7ec9481349495e230cdaab42&format=json')
        setUser(await response.json());

    }
    useEffect(() => {
        getUser();
    }, [apiKey]);

    return (

        <div className="card">
            <div className="card-body">
                <h5 className="card-title">{data.title}</h5>
                <h6 className="card-subtitle mb-2 text-muted">{data.subtitle}</h6>
                <p className="card-text">{data.description}</p>
            </div>
        </div>

    );
}

export default Card;
